function KeystoneLoot:GetItemInfo(itemId)
	return _items[itemId];
end

function KeystoneLoot:GetItemSource(itemId)
	if (not itemId) then
		return;
	end

	if (self:GetCatalystItems()[itemId]) then
		return 'catalyst';
	end

	if (not self:GetItemInfo(itemId)) then
		return;
	end

	for _, dungeon in ipairs(self:GetDungeonList()) do
		for _, lootItemId in ipairs(dungeon.lootTable) do
			if (lootItemId == itemId) then
				return dungeon.challengeModeId;
			end
		end
	end

	for _, raid in ipairs(self:GetRaidList()) do
		for _, boss in ipairs(raid.bossList) do
			for _, itemList in pairs(boss.lootTable) do
				for _, lootItemId in ipairs(itemList) do
					if (lootItemId == itemId) then
						return boss.bossId;
					end
				end
			end
		end
	end
end
